import http from './base-http-service';

const createGroup = (group) => http.post('/group', group)
  .then(response => response.data);

const listGroups = (id) => http.get(`/group/${id}`)
  .then(response => response.data);

const deleteGroups = (id) => http.get(`/group/${id}`)
.then(response => response.data);


export default {
  createGroup,
  listGroups
}
